import React from 'react'
import {Navbar, Nav, Container, NavDropdown} from 'react-bootstrap';
const NavBar = () => {
  return (
    <div>
      

            {/* Categories Dropdown */}
            <NavDropdown title="Categories" id="categories-dropdown">
              <NavDropdown.Item href="#Washing%20Machine">Washing Machine</NavDropdown.Item>
              <NavDropdown.Item href="#Oven">Oven</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#Tv%20%26%20Home%20Theatre">Tv & Home Theatre</NavDropdown.Item>
              <NavDropdown.Item href="#Cameras%20%26%20Drones">Cameras & Drones</NavDropdown.Item>
            </NavDropdown>

          
    </div>
  )
}

export default NavBar
